@pemkotdepok kembali mengumumkan penambahan kasus baru pasien positif Covid-19, per Selasa (25/8).

Tercatat kasus baru yang ada di Depok sebanyak 28 pasien. Sementara ada 46 pasien yang diklaim pulih, dan 2 pasien meninggal. 

Dengan ini, total kasus Covid-19 yang sedang tercatat di Depok berkurang 20 orang, menjadi 597 pasien.

